import logo from './logo.svg';
import './App.css';

function App() {

  let post = '강남 우동 맛집 :)';


  return (
    <div className="App">
      <div className='black-nav'>
      <h4>블로그 입니다.</h4>
      </div>
      <div className='list'>
        <h4>글 제목 입니다.</h4>
        <p>2023년 </p>
      </div>
      <h4> {post} </h4>
    </div>
  );
}

export default App;
